import React from "react";
import Button from "../../component/Button/Button";
import {Link} from "react-router-dom";
import background from "../../img/section4.png";
import Homepage from "../../img/Homepage01.webp";

import './home.scss'

function Home() {
    return (
        <>
            <section className="homepage">
                <img className="homepage__background" src={Homepage} alt=""/>
                <Button className="header__button" name='Open'/>
            </section>
            <section>
                <h2>Home page</h2>
                <Button className="header__button" name='Discover Ivy & Ace'/>
                <Link to='/blog'>Blog</Link>
            </section>
        </>
    )
}
export default Home
